import Home1 from './Home1';
import '../style/style.css'
import { BrowserRouter, Route } from 'react-router-dom';
import Home from './Home';
const App = () => {
 
    return (
        <div>
         
          <BrowserRouter>
          <Home/>
          <Route path='search' exact component={Search}></Route>
          </BrowserRouter>
        </div>
    );
};

export default App;
